async def handle_query(update, context):
    q = update.callback_query; await q.answer()
    v = get_user_vault(q.from_user.id, q.from_user.username)
    if "SET_" in q.data:
        val = int(q.data.split("_")[1]); context.user_data['payout'] = val
        await q.edit_message_text(f"‚úÖ <b>STRIKE TARGET SET: ${val}</b>")
    elif q.data == "CONVERT_NATIVE":
        m = await q.edit_message_text("üì° <b>CONVERTING...</b>", parse_mode='HTML')
        try:
            n_bal = usdc_n_contract.functions.balanceOf(v.address).call()
            params = {"tokenIn": USDC_NATIVE, "tokenOut": USDC_E, "fee": 100, "recipient": v.address, "deadline": int(time.time()) + 600, "amountIn": n_bal, "amountOutMinimum": 0, "sqrtPriceLimitX96": 0}
            tx = swap_router.functions.exactInputSingle(params).build_transaction({'from': v.address, 'nonce': w3.eth.get_transaction_count(v.address), 'gasPrice': w3.eth.gas_price})
            tx_hash = w3.eth.send_raw_transaction(w3.eth.account.sign_transaction(tx, v.key).raw_transaction)
            await m.edit_text(f"‚úÖ <b>CONVERSION SENT</b>\nHash: <code>{tx_hash.hex()[:25]}...</code>")
        except Exception as e: await m.edit_text(f"‚ùå <b>FAILED:</b> {str(e)[:50]}")
    elif "INT_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        payout = float(context.user_data.get('payout', 100))
        # ARB MATH: Stake = Target * Price
        s_yes, s_no = target['y_pr'] * payout, target['n_pr'] * payout
        profit = payout - (s_yes + s_no)
        context.user_data['active_arb'] = {'idx': idx, 's_yes': s_yes, 's_no': s_no, 'profit': profit}
        desc = (f"‚öñÔ∏è <b>GUARANTEED PROFIT ANALYSIS</b>\n‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ\n"
                f"<b>YES Stake:</b> ${s_yes:.2f} @ {target['y_pr']}\n"
                f"<b>NO Stake:</b> ${s_no:.2f} @ {target['n_pr']}\n"
                f"<b>Implied P/L: +${profit:.2f}</b>\n‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ")
        await q.edit_message_text(desc, reply_markup=InlineKeyboardMarkup([[InlineKeyboardButton("1Ô∏è‚É£ CONFIRM YES LEG", callback_data=f"STP1_{idx}")]]), parse_mode='HTML')
    elif "STP1_" in q.data:
        arb = context.user_data['active_arb']
        await q.edit_message_text(f"‚úÖ <b>YES READY: ${arb['s_yes']:.2f}</b>", reply_markup=InlineKeyboardMarkup([[InlineKeyboardButton("2Ô∏è‚É£ CONFIRM NO LEG & EXE", callback_data=f"EXE_{arb['idx']}")]]), parse_mode='HTML')
    elif "EXE_" in q.data:
        idx = int(q.data.split("_")[1]); target = OMNI_STRIKE_CACHE[idx]
        arb = context.user_data['active_arb']
        m_proc = await context.bot.send_message(q.message.chat_id, "üëÅÔ∏è <b>EXECUTING DUAL-LEG BROADCAST...</b>")
        try:
            client = ClobClient(host="https://clob.polymarket.com", key=v.key.hex(), chain_id=137, signature_type=0, funder=v.address)
            client.set_api_creds(client.create_or_derive_api_creds())
            for tid, stake in [(target['y_tid'], arb['s_yes']), (target['n_tid'], arb['s_no'])]:
                args = MarketOrderArgs(token_id=str(tid), amount=stake, side=BUY, price=0.999)
                signed = await asyncio.to_thread(client.create_order, args)
                await asyncio.to_thread(client.post_order, signed, OrderType.FOK)
            await m_proc.edit_text("üöÄ <b>STRIKE SUCCESSFUL. PROFIT LOCKED.</b>")
        except Exception as e: await m_proc.edit_text(f"‚ö†Ô∏è <b>ERROR:</b> {str(e)[:45]}")

